import './App.css';
import { Characters } from './Data/Characters';

function ScriptChart() {
  //var searchBarEntry = document.getElementById("number").value;

  return (
    <div>{/* Kana type */}
      <h2>selected Character</h2>
      <br/>
      <input type="checkbox" id="romanji" name="romanji" value="Romanji"/>
      <label>Romanji</label>
      <input type="checkbox" id="hiragana" name="hiragana" value="Hiragana"/>
      <label>Hiragana</label>
      <input type="checkbox" id="katakana" name="katakana" value="Katakana"/>
      <label>Katakana</label>

      <br/>
      <input type="checkbox" id="dakuten" name="dakuten" value="Dakuten"/>
      <label>Dakuten</label>
      <input type="checkbox" id="handakuten" name="handakuten" value="Handakuten"/>
      <label>Handakuten</label>

      
    </div>
  );
}

export default ScriptChart;
